import React from 'react';
import { TextField, Button, InputLabel, Input, FormHelperText, FormControl } from '@material-ui/core';

function Sokpage() {
    return (
        <form name="sokeform" action="#" onSubmit={(e) => e.preventDefault()}>
            <InputLabel htmlFor="orgnr">Søk på organisasjonsnummer</InputLabel>
            <Input id="orgnr" aria-describedby="orgnr-sok" />
        </form>
    );
}

export default Sokpage;
